def find_nested_bracket_index(s: str) -> int:
    '''
    Finds the index of the first nested bracket, if exists.

    Args:
        s: A string composed of '[' and ']'.

    Returns:
        The index of the first nested opening bracket, or -1 if no nested bracket exists.
    '''
    # Stack to keep track of the indices of the opening brackets
    stack = []

    for index, char in enumerate(s):
        if char == '[':
            stack.append(index)
        elif char == ']':
            if stack:
                stack.pop()  # Simple balancing of brackets

        # If there is already a bracket in the stack, it means nesting is possible
        if len(stack) > 1:
            return stack[0]  # The first opening bracket is nested if stack length > 1

    return -1  # No nesting found
